import './App.css';
import 'antd/dist/antd.css';
import { Col, Row, Button } from 'antd';

function App() {
  return (
    <div style={{padding: '0px 10px', minHeight: '100vh', fontFamily: 'cinzel'}}>
      <Row>
        <Col span={24} style={{paddingTop: '10vh'}} align="center">
          <img style={{width: '175px'}} src="https://media0.giphy.com/media/pkFr2QFMLrvwlFgvim/giphy.gif?cid=ecf05e475ihf4hp2x9rdxwn122r6p290w6nbgtffqzsx4hju&rid=giphy.gif&ct=g" alt="a"/>
          <br/>
          <br/>
          <h3>Software Engineer by profession but aren't we all gamblers?</h3>
        </Col>
      </Row>
      <br/>
      <hr/>
      <Row>
        <Col span={24} align="center">
          Name : Neelesh Sharma <hr/>
          City : Gurgaon, Haryana <hr/>
          Education : Bachelor of Technology, IIT Roorkee <hr/>
          Expertise : Software Development and Project Management <hr/>

          <Button type="default">Download CV</Button>
          <Button type="default">Download Resume</Button>
        </Col>
      </Row>
    </div>
  );
}

export default App;
